g2:c.PROCEDURE.g2:a.TEXT:
float-variable-overflow-by-value-test(node: class benchmark-node)
status: truth-value; 
status-text: text;
begin
status, status-text = call float-variable-overflow-by-value-test-inner();
if status then
    call fail(node, status-text)
else
    call pass(node); 
end

float-variable-overflow-by-value-test-inner()  = (truth-value, text)
x : float; 
begin
    conclude that float-var has no value; 
    conclude that the formula of float-var = "none"; 
    conclude that float-var = 200L*100*200*100*300*30;
    collect data
        x = float-var; 
    end;
    if x /= 3.6e12 then
        return true, "Variable value overflow";
    return false, "";
end

float-variable-overflow-by-formula-test-inner()  = (truth-value, text)
x : float; 
begin
    conclude that float-var has no value; 
    conclude that the formula of float-var = "200L*100*200*100*300*33";
    collect data
        x = float-var;
    end;
    if x /= 3.96e12 then
        return true, "Variable formula overflow";
    return false, ""
end

float-variable-overflow-by-formula-test(node: class benchmark-node)
status: truth-value; 
status-text: text;
begin
status, status-text = call float-variable-overflow-by-formula-test-inner();
if status then
    call fail(node, status-text)
else
    call pass(node); 
end
